class Solution:
    def findTheDifference(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """
        if len(t) == 0 or (len(t) - len(s) != 1):
            return ''
        hash_store = {}
        for i in s:
            hash_store[i] = hash_store.get(i, 0) + 1
        for j in t:
            if hash_store.get(j, 0) == 0:
                return j
            elif hash_store.get(j, 0) > 1:
                    hash_store[j] = hash_store.get(j, 0) - 1
            else:
                hash_store.pop(j)

        return ''

if __name__ == '__main__':
    solution = Solution()
    print(solution.findTheDifference("",
""))
